function changeLogo() {
  const logoPattern = document.querySelector('pattern[id="0-a"]');
  if (logoPattern) {
    const imageElement = logoPattern.querySelector('image');
    if (imageElement) {
      imageElement.setAttribute(
        "xlink:href",
        "data:image/png;base64,"
      );
      return true;
    }
  }
  return false;
}

function observeDOMChange() {
  const observer = new MutationObserver((mutations) => {
    for (const mutation of mutations) {
      if (mutation.type === 'childList') {
        if (changeLogo()) {
          observer.disconnect();
          break;
        }
      }
    }
  });

  observer.observe(document.body, {
    childList: true,
    subtree: true,
  });
}

if (!changeLogo()) {
  observeDOMChange();
}
